import React from 'react'

function TopNavBar() {
  return (
    <div className='pb-2 flex justify-end'> 
        <a href="true" className="text-red-500 text-s">Log In</a>
        <a href="true" className="text-red-500 ml-3 text-s">Sign Up</a>
    </div>
  )
}

export default TopNavBar
